import './Catalog.css';

import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faPlus } from '@fortawesome/free-solid-svg-icons';

import { Button, Col, Container, Row } from "react-bootstrap";

function Catalog(){

    const ArraysOfCatalog = [{}];
    const ArraysOfCatalogOnMap = ArraysOfCatalog.map((ArrayOfCatalog) => 
    <Col className = "wrapper" lg = "4" md = "6" sm = "12">
        <div class = "image">

        </div>

        <div class = "buttons">
            <Button variant="warning">Купить сейчас <FontAwesomeIcon icon={faPlus}/> </Button>
            <Button variant="secondary">В корзину</Button>
        </div>
    </Col>
    )

    return(
        <Container>
            <Row>
                {ArraysOfCatalogOnMap}
            </Row>
        </Container>
    )
}

export default Catalog
